import React from 'react';
import { NavLink } from 'react-router-dom';

const Navigation = () => {
    return(
        <div>
            <NavLink to="/" color="red">Home</NavLink>
            <NavLink to="/login">Login</NavLink>
            <NavLink to="/registration">Registration</NavLink>
        </div>
        
    );
}

export default Navigation;
